<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">

    <title>Document</title>
    <style>
        body {
            margin: 0;
            background-color: #131313;
            height: 100vh;
            display: grid;
            place-items: center;
        }

        .text path {
            fill: transparent;
            stroke: #01ff01;
            animation: line 5s linear forwards, fill 4s linear 2s forwards;

        }


        .text path:first-child {
            stroke-dasharray: 98px;
            stroke-dashoffset: 98px;

        }

        .text path:nth-child(2) {
            stroke-dasharray: 101px;
            stroke-dashoffset: 101px;
        }

        .text path:nth-child(3) {
            stroke-dasharray: 200px;
            stroke-dashoffset: 200px;
        }

        .text path:nth-child(4) {
            stroke-dasharray: 191px;
            stroke-dashoffset: 191px;
        }

        .text path:nth-child(5) {
            stroke-dasharray: 111px;
            stroke-dashoffset: 111px;
        }

        .text path:last-child {
            stroke-dasharray: 200px;
            stroke-dashoffset: 200px;
        }

        @keyframes line {
            to {
                stroke-dashoffset: 0;
            }
        }

        @keyframes fill {
            to {
                fill: #ff0000;
            }
        }



     
    </style>
